import React, { useEffect } from "react";
import API from "../API/API";

export default function LoginPage() {
  useEffect(() => {
    document.title = "Авторизация";
    let code = window.location.search.split("=")[1];
    if (code) {
      API.login();
    }
  }, []);

  return (
    <div className="Login">
      <h1>Test</h1>
    </div>
  );
}
